@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_31a rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset in the first months or years of life of refractory seizures and global developmental delay from early infancy that has_material_basis_in heterozygous mutation in the DNM1 gene on chromosome 9q34." ;
    :has_exact_synonym "DEE31",
        "DEE31A",
        "developmental and epileptic encephalopathy 31",
        "early infantile epileptic encephalopathy 31" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_5 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by global developmental delay and onset in the first months of life of tonic seizures or infantile spasms that has_material_basis_in heterozygous mutation in the SPTAN1 gene on chromosome 9q34." ;
    :has_exact_synonym "DEE5",
        "early infantile epileptic encephalopathy 5" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_14 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by refractory focal seizures developing by 6 months of age and arrest of psychomotor development that has_material_basis_in heterozygous mutation in the KCNT1 gene on chromosome 9q34." ;
    :has_exact_synonym "DEE14",
        "early infantile epileptic encephalopathy 14" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset in the first months of life of erratic, typically myoclonic, refractory seizures that has_material_basis_in homozygous or compound heterozygous mutation in the SLC25A22 gene on chromosome 11p15." ;
    :has_exact_synonym "early infantile epileptic encephalopathy 3" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_49 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by neonatal onset of seizures, global developmental delay with intellectual disability and lack of speech, hypotonia, spasticity, and coarse facial features that has_material_basis_in homozygous or compound heterozygous mutation in the DENND5A gene on chromosome 11p15." ;
    :has_exact_synonym "DEE49",
        "early infantile epileptic encephalopathy 49" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_41 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset in the first days or weeks of life of seizures, severely impaired psychomotor development, and brain anomalies including delayed myelination, thin corpus callosum, and cerebral atrophy that has_material_basis_in heterozygous mutation in the SLC1A2 gene on chromosome 11p13." ;
    :has_exact_synonym "DEE41",
        "early infantile epileptic encephalopathy 41" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_21 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset in the first months of life by intractable seizures and severely impaired psychomotor development that has_material_basis_in homozygous or compound heterozygous mutation in the NECAP1 gene on chromosome 12p13." ;
    :has_exact_synonym "DEE21",
        "early infantile epileptic encephalopathy 21" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_27 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by early onset seizures, delayed psychomotor development and intellectual disability with variable severity that has_material_basis_in heterozygous mutation in the GRIN2B gene on chromosome 12p12." ;
    :has_exact_synonym "DEE27",
        "early infantile epileptic encephalopathy 27" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_13 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset of intractable seizures in the first year of life with impaired development or developmental regression after seizure onset that has_material_basis_in heterozygous mutation in the SCN8A gene on chromosome 12q13." ;
    :has_exact_synonym "DEE13",
        "early infantile epileptic encephalopathy 13" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_66 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset in the first days or weeks of life of seizures, global developmental delay with hypotonia, behavioral abnormalities, and dysmorphic features or ophthalmologic defects that has_material_basis_in heterozygous mutation in the PACS2 gene on chromosome 14q32." ;
    :has_exact_synonym "DEE66",
        "early infantile epileptic encephalopathy 66" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_43 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset in the first year of life of seizures, global developmental delay, and mild to moderate intellectual disability that has_material_basis_in heterozygous mutation in the GABRB3 gene on chromosome 15q11." ;
    :has_exact_synonym "DEE43",
        "early infantile epileptic encephalopathy 43" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_48 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by seizure onset before 1 year of age, global developmental delay, intellectual disability, absent speech, and minimal or absent motor development that has_material_basis_in homozygous or compound heterozygous mutation in the AP3B2 gene on chromosome 15q25." ;
    :has_exact_synonym "DEE48",
        "early infantile epileptic encephalopathy 48" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_16 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by seizure onset in the first weeks or months of life, delayed or regression of psychomotor development, and hypotonia that has_material_basis_in homozygous or compound heterozygous mutation in the TBC1D24 gene on chromosome 16p13." ;
    :has_exact_synonym "DEE16",
        "early infantile epileptic encephalopathy 16" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_17 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset in the first weeks or months of life of intractable seizures and very poor psychomotor development that has_material_basis_in heterozygous mutation in the GNAO1 gene on chromosome 16q13." ;
    :has_exact_synonym "DEE17",
        "early infantile epileptic encephalopathy 17" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_29 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset in the first months of life of refractory myoclonic seizures, poor overall growth, congenital microcephaly with cerebral atrophy and impaired myelination on brain imaging, spasticity with abnormal movements, peripheral neuropathy, and poor visual fixation that has_material_basis_in homozygous or compound heterozygous mutation in the AARS1 gene on chromosome 16q22." ;
    :has_exact_synonym "DEE29",
        "early infantile epileptic encephalopathy 29" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_28 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset in the first months of life of refractory seizures, severe axial hypotonia, and profoundly impaired psychomotor development that has_material_basis_in homozygous or compound heterozygous mutation in the WWOX gene on chromosome 16q23." ;
    :has_exact_synonym "DEE28",
        "early infantile epileptic encephalopathy 28" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_25 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :intellectual_disability ],
        :autosomal_recessive_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset in early infancy of refractory seizures, global developmental delay with intellectual disability, persistent neurologic symptoms, and dental anomalies that has_material_basis_in homozygous or compound heterozygous mutation in the SLC13A5 gene on chromosome 17p13." ;
    :has_exact_synonym "DEE25",
        "developmental and epileptic encephalopathy 25, with amelogenesis imperfecta",
        "early infantile epileptic encephalopathy 25" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_42 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset of seizures in the first hours or days of life and global developmental delay with severely impaired intellectual development that has_material_basis_in heterozygous mutation in the CACNA1A gene on chromosome 19p13." ;
    :has_exact_synonym "DEE42",
        "early infantile epileptic encephalopathy 42" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_52 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by infantile onset of refractory seizures and global neurological development delay, and intellectual disability that has_material_basis_in homozygous or compound heterozygous mutation in the SCN1B gene on chromosome 19q13." ;
    :has_exact_synonym "DEE52",
        "early infantile epileptic encephalopathy 52" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_46 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset in the first months or years of life of intractable seizures, global developmental delay, failure to thrive, hypotonia, hyperreflexia, and variably impaired intellectual development that has_material_basis_in heterozygous mutation in the GRIN2D gene on chromosome 19q13." ;
    :has_exact_synonym "DEE46",
        "early infantile epileptic encephalopathy 46" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:microcephaly_seizures_and_developmental_delay rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by microcephaly, infantile onset of seizures and developmental delay that has_material_basis_in homozygous or compound heterozygous mutation in the PNKP gene on chromosome 19q13." ;
    :has_exact_synonym "developmental and epileptic encephalopathy 10",
        "early infantile epileptic encephalopathy 10"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_35 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by seizure onset in the first months of life, absence of normal development and absence of myelination of early neurological structures that has_material_basis_in homozygous or compound heterozygous mutation in the ITPA gene on chromosome 20p13." ;
    :has_exact_synonym "DEE35",
        "early infantile epileptic encephalopathy 35",
        "ITPA-related encephalopathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_12 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset of refractory seizures in the first year of life with normal to mild developmental delay before onset of seizures but developmental regression and stagnation after seizure onset that has_material_basis_in homozygous or compound heterozygous mutation in the PLCB1 gene on chromosome 20p12.3." ;
    :has_exact_synonym "DEE12",
        "early infantile epileptic encephalopathy 12" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_34 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by infantile onset of refractory migrating focal seizures, developmental regression and severe global impairment that has_material_basis_in homozygous or compound heterozygous mutation in the SLC12A5 gene on chromosome 20q12." ;
    :has_exact_synonym "DEE34",
        "early infantile epileptic encephalopathy 34" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_26 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset in the first years of life of seizures, developmental delay, intellectual disability, poor speech, and behavioral abnormalities that has_material_basis_in heterozygous mutation in the KCNB1 gene on chromosome 20q13." ;
    :has_exact_synonym "DEE26",
        "early infantile epileptic encephalopathy 26" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_7 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by infantile onset of refractory seizures, delayed neurological development, and persistent neurologic abnormalities that has_material_basis_in heterozygous mutation in the KCNQ2 gene on chromosome 20q13." ;
    :has_exact_synonym "early infantile epileptic encephalopathy 7",
        "KCNQ2-related epileptic encephalopathy"@en,
        "KCNQ2-related neonatal epileptic encephalopathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_33 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset in the first months of life of seizures and severe global developmental delay with impaired intellectual development and poor or absent speech that has_material_basis_in heterozygous mutation in the EEF1A2 gene on chromosome 20q13." ;
    :has_exact_synonym "DEE33",
        "early infantile epileptic encephalopathy 33" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_53 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by infantile onset of intractable seizures, hypotonia, poor or absent global development, severe intellectual disability and spastic quadriplegia that has_material_basis_in homozygous or compound heterozygous mutation in the SYNJ1 gene on chromosome 21q22." ;
    :has_exact_synonym "DEE53",
        "early infantile epileptic encephalopathy 53" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_30 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset in the first few months of life of refractory seizures andseverely impaired or absent developmental progress that has_material_basis_in heterozygous mutation in the SIK1 gene on chromosome 21q22." ;
    :has_exact_synonym "DEE30",
        "early infantile epileptic encephalopathy 30" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_dominant_inheritance ],
        :developmental_and_epileptic_encephalopathy,
        :x_linked_dominant_disease ;
    :has_definition "A developmental and epileptic encephalopathy characterized by X-linked dominant inheritance of seizure onset in the first months of life, intellectual disability, and poor motor control that has_material_basis_in mutation in the CDKL5 gene on chromosome Xp22." ;
    :has_exact_synonym "DEE2",
        "EIEE2",
        "early infantile epileptic encephalopathy 2",
        "X-linked infantile spasm syndrome 2"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :developmental_and_epileptic_encephalopathy,
        :x_linked_recessive_disease ;
    :has_definition "A developmental and epileptic encephalopathy characterized by X-linked recessive inheritance of frequent tonic seizures or spasms beginning in infancy that has_material_basis_in mutation in the ARX gene on chromosome Xp21." ;
    :has_exact_synonym "DEE1",
        "early infantile epileptic encephalopathy 1",
        "X-linked infantile spasm syndrome 1"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_36 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_dominant_inheritance ],
        :developmental_and_epileptic_encephalopathy,
        :x_linked_dominant_disease ;
    :has_definition "A developmental and epileptic encephalopathy characterized by X-linked dominant inheritance of infantile onset of seizures, delayed psychomotor development and in some patients dysmorphic features that has_material_basis_in heterozygous mutation in the ALG13 gene on chromosome Xq23." ;
    :has_exact_synonym "congenital disorder of glycosylation, type Is",
        "early infantile epileptic encephalopathy 36" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_92 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset of seizures in infancy or early childhood, global developmental delay and variable intellectual disability that has_material_basis_in heterozygous mutation in the GABRB2 gene on chromosome 5q34." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_91 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
