    :has_definition "A bronchiectasis that has_material_basis_in mutation in the gene encoding the gamma subunit of the epithelial sodium channel." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:granular_corneal_dystrophy_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :granular_corneal_dystrophy ;
    :has_definition "A granular corneal dystrophy that is characterized by recurrent erosions and gray crumb-like opacification located_in the cornea, proteinaceous rock candy-like deposits in the anterior stroma and subepithelium, and progressive vision loss later in life as deposits move into the central vision, and has_material_basis_in autosomal dominant inheritance of heterozygous mutation of transforming growth factor beta-induced gene located in chromosome 5q31.1, which encodes keratoepithelin. Abnormalities lead to increased protein deposition and disruption of the corneal surface." ;
    :has_exact_synonym "corneal dystrophy, Groenouw type I"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

