        :autosomal_recessive_disease,
        :congenital_disorder_of_glycosylation_type_i ;
    :has_definition "A congenital disorder of glycosylation I that is characterized by severe neurologic involvement associated with dysmorphism and visual impairment and has_material_basis_in homozygous or compound heterozygous mutation in the ALG3 gene on chromosome 3q27." ;
    :has_exact_synonym "congenital disorder of glycosylation 1d"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
