    :has_definition "A congenital disorder of glycosylation I that is characterized by progressive microcephaly, hypotonia, developmental delay, drug-resistant infantile epilepsy, and hepatomegaly and has_material_basis_in homozygous mutation in the ALG9 gene on chromosome 11q23." ;
    :has_exact_synonym "congenital disorder of glycosylation 1l"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
