        :autosomal_recessive_disease,
        :congenital_disorder_of_glycosylation_type_i ;
    :has_definition "A congenital disorder of glycosylation I that is characterized by muscular hypotonia and ichthyosis and has_material_basis_in homozygous mutation in the DOLK gene, which encodes the enzyme responsible for the final step of the de novo biosynthesis of dolichol phosphate, on chromosome 9q34." ;
    :has_exact_synonym "DOLK-congenital disorder of glycosylation"@en,
        "congenital disorder of glycosylation 1m"@en,
        "dolichol kinase deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

