    :has_definition "A congenital disorder of glycosylation I that is characterized by facial dysmorphism (microcephaly, high forehead, low posterior hairline, strabismus), hypotonia, failure to thrive, intractable seizures, developmental delay, persistent vomiting and gastric bleeding and has_material_basis_in homozygous or compound heterozygous mutation in the ALG11 gene on chromosome 13q14." ;
    :has_exact_synonym "congenital disorder of glycosylation 1p"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

