        :autosomal_recessive_disease,
        :congenital_disorder_of_glycosylation_type_i ;
    :has_definition "A congenital disorder of glycosylation I that is characterized by a highly variable phenotype typically presenting with severe visual impairment, variable ocular anomalies (such as optic nerve hypoplasia/atrophy, iris and optic nerve coloboma, congenital cataract, glaucoma), intellectual disability, cerebellar abnormalities, nystagmus, hypotonia, ataxia, and/or ichthyosiform skin lesions and has_material_basis_in homozygous or compound heterozygous mutation in the SRD5A3 gene on chromosome 4q12." ;
    :has_exact_synonym "congenital disorder of glycosylation 1q"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_disorder_of_glycosylation_ir rdfs:subClassOf [ a owl:Restriction ;
