            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :congenital_disorder_of_glycosylation_type_i ;
    :has_definition "A congenital disorder of glycosylation I that is characterized by failure to thrive, developmental delay, hypotonia, strabismus and hepatic dysfunction and has_material_basis_in compound heterozygous mutation in the DDOST gene on chromosome 1p36." ;
    :has_exact_synonym "congenital disorder of glycosylation 1r"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

