        [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :autosomal_recessive_disease,
        :congenital_disorder_of_glycosylation_type_i ;
    :has_definition "A congenital disorder of glycosylation I that is characterized by respiratory distress and severe hypotonia at birth, severe global developmental delay, early-onset intractable seizures, myopathic fascies with craniofacial dysmorphism (trigonocephaly/progressive microcephaly, low anterior hairline, arched eyebrows, hypotelorism, strabismus, small nose, prominent philtrum, thin upper lip, high-arched palate, micrognathia, malocclusion), severe, congenital flexion joint contractures and elevated serum creatine kinase levels and has_material_basis_in homozygous or compound heterozygous mutation in the DPM2 gene on chromosome 9q34." ;
    :has_exact_synonym "congenital disorder of glycosylation 1u"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

