            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :congenital_disorder_of_glycosylation_type_i ;
    :has_definition "A congenital disorder of glycosylation I that is characterized by developmental delay, intellectual disability, failure to thrive, hypotonia and seizures and has_material_basis_in homozygous mutation in the STT3A gene on chromosome 11q24." ;
    :has_exact_synonym "congenital disorder of glycosylation 1w"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

