        :autosomal_recessive_disease,
        :congenital_disorder_of_glycosylation_type_i ;
    :has_definition "A congenital disorder of glycosylation I that is characterized by intrauterine growth retardation, microcephaly, failure to thrive, developmental delay, intellectual disability, hypotonia, seizures, optic nerve atrophy and respiratory difficulties and has_material_basis_in homozygous mutation in the STT3B gene on chromosome 3p23." ;
    :has_exact_synonym "congenital disorder of glycosylation 1x"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

