    :has_definition "A congenital disorder of glycosylation I that is characterized by neurologic abnormalities (global developmental delay in language, social skills and fine and gross motor development, intellectual disability, hypotonia, microcephaly, seizures/epilepsy), facial dysmorphism (deep set eyes, large ears, hypoplastic vermillion of upper lip, large mouth with widely spaced teeth), feeding problems often due to chewing difficulties and aversion to food with certain textures, failure to thrive, gastrointestinal abnormalities (reflux or vomiting) and strabismus and has_material_basis_in hemizygous mutation in the SSR4 gene on chromosome Xq28." ;
    :has_exact_synonym "congenital disorder of glycosylation 1y"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
