    :has_exact_synonym "Larsen-like syndrome, B3GAT3 type"@en,
        "multiple joint dislocations-short stature-craniofacial dysmorphism-congenital heart defects syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
