:polygenic_disease rdfs:subClassOf :genetic_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :polygenic_inheritance ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A genetic disease that is characterized by the additive contributions of variants in multiple genes at different loci." .

