    :has_definition """A syndrome that is characterized by bilateral choanal atresia, cranio-facial dysmorphism, 
hearing loss, heart abnormalities, and short stature.""" ;
    :has_exact_synonym "Choanal atresia - deafness - cardiac defects - dysmorphism syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:winchester_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :osteolysis ],
        :syndrome ;
    :has_definition "A syndrome that is characterized by a loss of bone tissue particularly in the hands and feet." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:opitz_gbbb_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :syndrome,
        :x_linked_recessive_disease ;
    :has_definition "A syndrome that is a congenital midline malformation syndrome that is characterized by hypertelorism, hypospadias, cleft lip/palate, laryngotracheoesophageal abnormalities, imperforate anus, developmental delay, and cardiac defects and that has_material_basis_in mutation in the MID1 gene on chromosome Xp22." ;
    :has_exact_synonym "Opitz G/BBB Syndrome"@en,
        "Opitz GBBB syndrome type I"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:teebi_hypertelorism_syndrome_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :teebi_hypertelorism_syndrome ;
    :has_definition "A Teebi hypertelorism syndrome that has_material_basis_in mutation in heterozygous mutation in the SPECC1L gene on chromosome 22q11.2 or heterozygous deletion at chromosome 22q11.2." ;
    :has_exact_synonym "Opitz GBBB syndrome type II"@en,
        "SPECC1L-related hypertelorism syndrome"@en,
        "Teebi hypertelorism syndrome-1"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glutathione_synthetase_deficiency rdfs:subClassOf :amino_acid_metabolic_disorder ;
    :has_definition "An amino acid metabolic disorder characterized by the lack of glutathione production." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:caudal_regression_syndrome rdfs:subClassOf :physical_disorder ;
    :has_definition "A physical disorder that is characterized by impairment of the development of the lower half of the body." ;
    :has_exact_synonym "caudal dysgenesis syndrome",
        "caudal dysplasia sequence",
        "caudal regression sequence",
        "sacral agenesis",
        "sacral defect with anterior meningocele" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prothrombin_thrombophilia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :thrombophilia ;
    :has_definition "A thrombophilia that is characterized by increases the risk of blood clots including deep vein thrombosis and pulmonary embolism and that has_material_basis_in heterozygous mutation in the thrombin gene (F2 gene) on chromosome 11p11." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:medulloblastoma_wnt_activated rdfs:subClassOf :medulloblastoma ;
    :has_definition "A medulloblastoma that is characterized as a molecular subtype by activation of the WNT pathway and TP53 mutations may be present or absent." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:medulloblastoma_shh_activated rdfs:subClassOf :medulloblastoma ;
    :has_definition "A medulloblastoma that is characterized as a molecular subtype by activation of the sonic hedgehog (SHH) pathway and TP53 mutations that may be present or absent." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:medulloblastoma_shh_activated_and_tp53_mutant rdfs:subClassOf :medulloblastoma_shh_activated ;
    :has_definition "A medulloblastoma SHH activated that is characterized as a molecular subtype by activation of the sonic hedgehog (SHH) pathway and the presence of TP53 mutations." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:medulloblastoma_shh_activated_and_tp53_wild_type rdfs:subClassOf :medulloblastoma_shh_activated ;
    :has_definition "A medulloblastoma SHH activated that is characterized as a molecular subtype by activation of the sonic hedgehog (SHH) pathway and the absence of TP53 mutations." ;
    :has_exact_synonym "Medulloblastoma SHH-Activated TP53-Wildtype" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:medulloblastoma_non_wnt_non_shh rdfs:subClassOf :medulloblastoma ;
    :has_definition "A medulloblastoma that is characterized as a molecular subtype that is not associated with activation of the WNT pathway or sonic hedgehog (SHH) pathway and TP53 mutations are absent." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:medulloblastoma_non_wnt_non_shh_group_3 rdfs:subClassOf :medulloblastoma_non_wnt_non_shh ;
    :has_definition "A medulloblastoma non-WNT/non-SHH that is characterized as a molecular subtype by absent TP53 mutations and MYC amplifications that may be present." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:medulloblastoma_non_wnt_non_shh_group_4 rdfs:subClassOf :medulloblastoma_non_wnt_non_shh ;
    :has_definition "A medulloblastoma non-WNT/non-SHH that is characterized as a molecular subtype by the absence of MYC amplifications and TP53 mutations, while chromosome 17 abnormalities may be present." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nk_cell_deficiency rdfs:subClassOf :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease that results from defeciency in the number or function of CD56+CD3− NK cell in peripheral blood." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:t_cell_and_nk_cell_immunodeficiency rdfs:subClassOf :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease that involves multiple components of the immune system, including both T cell and NK cell immunodeficiency." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multisystem_inflammatory_syndrome_in_children rdfs:subClassOf :coronavirus_infectious_disease ;
    :has_definition "A Coronavirus infectious disease that is characterized by a patient aged less than 21 years with fever, laboratory evidence of inflammation, and evidence of clinically severe illness requiring hospitalization, with multisystem organ involvement (cardiovascular, dermatologic, gastrointestinal, hematologic, neurologic, renal, or respiratory) who tested positive for SARS-CoV-2 or had exposure to COVID-19." ;
    :has_exact_synonym "MIS-C",
        "multisystem inflammatory disorder in children and adolescents",
        "paediatric inflammatory multisystemic syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gene_duplication_disease rdfs:subClassOf :monogenic_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :has_material_basis_in ;
                                                    owl:someValuesFrom :gene ] ;
                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                            owl:onProperty :has_material_basis_in ;
                                                            owl:someValuesFrom :duplication ] ;
                                                    rdf:rest :nil ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A monogenic disease that is the result of a mutation that involves the production of one or more copies of a gene." ;
    :has_exact_synonym "gene duplication syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hereditary_alpha_tryptasemia_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :mast_cell ],
        [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :has_material_basis_in ;
                            owl:someValuesFrom :gene ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :duplication ] ;
                            rdf:rest :nil ] ] ],
        :gene_duplication_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by high blood tryptase levels and that has_material_basis_in inherited extra copies of the alpha tryptase gene (TPSAB1), effecting multiple organ systems including skin and connective tissues, the gastrointestinal and cardiovascular systems." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_82 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset of seizures in the first year of life, hypotonia, feeding difficulties, severely impaired intellectual development, and global developmental delay that has_material_basis_in homozygous or compound heterozygous mutation in the GOT2 gene on chromosome 16q21." ;
    :has_exact_synonym "DEE82",
        "early infantile epileptic encephalopathy 82" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:infantile_liver_failure_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :liver ],
        :liver_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by acute liver failure, that occurs in the first year of life, which manifests with failure to thrive, hypotonia, moderate global developmental delay, seizures, abnormal liver function tests, microcytic anemia and elevated serum lactate." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:infantile_liver_failure_syndrome_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :infantile_liver_failure_syndrome ;
    :has_definition "An infantile liver failure syndrome that has_material_basis_in homozygous mutation in the LARS gene (LARS1) on chromosome 5q32." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gne_myopathy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :autosomal_recessive_disease,
        :myopathy ;
    :has_definition "A myopathy that is characterized by progressive skeletal muscle atrophy, distal muscle weakness and bilateral foot drop caused by weakness of the anterior tibialis muscles with onset in early adulthood, and that has_material_basis_in mutations in the GNE gene which encodes the rate-limiting enzyme of sialic acid biosynthesis." ;
    :has_exact_match "MESH:C536816" ;
    :has_exact_synonym "Distal myopathy, Nonaka type",
        "Hereditary Inclusion Body Myopathy",
        "Nonaka myopathy",
        "inclusion body myopathy 2" ;
    :has_related_synonym "Distal Myopathy with Rimmed Vacuoles" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_6 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :autosomal_dominant_disease,
        :autosomal_recessive_disease,
        :congenital_myopathy ;
    :has_definition "A congenital myopathy that is characterized by childhood onset of congenital joint contractures, external ophthalmoplegia, and proximal muscle weakness, and that has_material_basis_in heterozygous, compound heterozygous, or homozygous mutation in the gene encoding myosin heavy chain IIa ( (MYHC2A or MYH2) on chromosome 17p13." ;
    :has_exact_synonym "inclusion body myopathy 3",
        "proximal myopathy and ophthalmoplegia" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_congenital_deafness_with_onychodystrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :physical_disorder,
        :syndrome ;
    :has_definition "A syndrome that is characterized by autosomal dominant inheritance of congenital deafness and onychodystrophy and that has_material_basis_in heterozygous mutation in the ATP6V1B2 gene on chromosome 8p21." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:calvarial_doughnut_lesions_with_bone_fragility rdfs:subClassOf :osteochondrodysplasia ;
    :has_definition "An osteochondrodysplasia that is characterized by low bone mineral density, multiple spinal and peripheral fractures beginning in childhood, and sclerotic doughnut-shaped lesions in the cranial bones." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:kenny_caffey_syndrome_type_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :kenny_caffey_syndrome ;
    :has_definition "A Kenny-Caffey syndrome that has_material_basis_in homozygous or compound heterozygous mutation in the TBCE gene, encoding tubulin-specific chaperone E, on chromosome 1q42." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:kenny_caffey_syndrome_type_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :kenny_caffey_syndrome ;
    :has_definition "A Kenny-Caffey syndrome that has_material_basis_in heterozygous mutation in the FAM111A gene on chromosome 11q12." ;
    :has_exact_match "MESH:C537020" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:kenny_caffey_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :skeletal_dysplasia ],
        :osteochondrodysplasia,
        :syndrome ;
    :has_definition "A syndrome that is characterized by growth retardation with proportionate short stature, cortical thickening and medullary stenosis of the long bones, delayed anterior fontanelle closure, hypocalcemia due to congenital hypoparathyroidism and facial dysmorphism, including prominent forehead, microphthalmia, and micrognathia." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:basan_syndrome rdfs:subClassOf :ectodermal_dysplasia ;
    :has_definition "An ectodermal dysplasia that is characterized by neonatal blisters and milia and congenital absence of dermatoglyphics on the hands and feet." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ehlers_danlos_syndrome_classic_type_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that has_material_basis_in heterozygous mutation in the collagen alpha-2(V) gene on chromosome 2q31 and that is characterized by the absence of widened atrophic scars." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ehlers_danlos_syndrome_arthrochalasia_type_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that is characterized by hypermobility in infants with dislocations of both hips at birth and has_material_basis_in heterozygous mutation in the COL1A1 gene on chromosome 17q21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ehlers_danlos_syndrome_arthrochalasia_type_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that has_material_basis_in heterozygous mutation in the COL1A2 gene on chromosome 7q21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brittle_cornea_syndrome_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :cornea ],
        :autosomal_recessive_disease,
        :corneal_disease,
        :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that has_material_basis_in homozygous mutation in the PRDM5 gene on chromosome 4q27." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ehlers_danlos_syndrome_cardiac_valvular_type rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that is characterized by severe problems with heart valves and that has_material_basis_in homozygous or compound heterozygous mutation in the COL1A2 gene on chromosome 7q21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ehlers_danlos_syndrome_classic_like_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that is characterized by hyperextensible skin, hypermobile joints, and tissue fragility and that has_material_basis_in omozygous or heterozygous mutation in the tenascin-XB gene (TNXB) on chromosome 6p21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ehlers_danlos_syndrome_classic_like_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that has_material_basis_in homozygous or compound heterozygous mutation in the AEBP1 gene on chromosome 7p13 and that is characterized by severe joint and skin laxity, osteoporosis involving the hips and spine, osteoarthritis, soft redundant skin that can be acrogeria-like, delayed wound healing with abnormal atrophic scarring, and shoulder, hip, knee, and ankle dislocations." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ehlers_danlos_syndrome_dermatosparaxis_type rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that is characterized by severe skin fragility, sagging, redundant skin and that has_material_basis_in mutation in the gene encoding the procollagen protease ADAMTS2 on chromosome 5q35." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ehlers_danlos_syndrome_kyphoscoliotic_type_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :ehlers_danlos_syndrome ;
    :has_definition """An Ehlers-Danlos syndrome that is characterized by severe muscle hypotonia at birth, generalized joint laxity, scoliosis at birth, and scleral fragility and rupture of the ocular globe
and that has_material_basis_in homozygous or compound heterozygous mutation in the gene encoding lysyl hydroxylase (PLOD1) on chromosome 1p36.""" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ehlers_danlos_syndrome_kyphoscoliotic_type_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that is characterized by severe muscle hypotonia at birth, progressive scoliosis, joint hypermobility, hyperelastic skin, myopathy, sensorineural hearing impairment, and normal pyridinoline excretion in urine and that has_material_basis_in homozygous or compound heterozygous mutation in the FKBP14 gene on chromosome 7p15." ;
    :has_exact_match "OMIM:614557" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ehlers_danlos_syndrome_musculocontractural_type_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that is characterized by distinctive craniofacial dysmorphism, congenital contractures of thumbs and fingers, clubfeet, severe kyphoscoliosis, muscular hypotonia, hyperextensible thin skin with easy bruisability and atrophic scarring, wrinkled palms, joint hypermobility, and ocular involvement and that has_material_basis_in homozygous or compound heterozygous mutation in the CHST14 gene on chromosome 15q14." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ehlers_danlos_syndrome_musculocontractural_type_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :autosomal_recessive_disease,
        :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that is characterized by progressive multisystem fragility-related manifestations, including joint dislocations and deformities; skin hyperextensibility, bruisability, and fragility, with recurrent large subcutaneous hematomas; cardiac valvular, respiratory, gastrointestinal, and ophthalmologic complications; and myopathy, featuring muscle hypoplasia, muscle weakness, and an abnormal muscle fiber pattern in histology in adulthood, resulting in gross motor developmental delay and that has_material_basis_in homozygous mutation in the DSE gene on chromosome 6q22." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ehlers_danlos_syndrome_spondylodysplastic_type_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that is characterized by short stature, developmental anomalies of the forearm bones and elbow, and bowing of extremities, in addition to the classic stigmata of Ehlers-Danlos syndrome, including joint laxity, skin hyperextensibility, and poor wound healing and that has_material_basis_in homozygous or compound heterozygous mutation in the B4GALT7 gene on chromosome 5q35." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ehlers_danlos_syndrome_spondylodysplastic_type_3 rdfs:subClassOf :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that has_material_basis_in homozygous mutation in the zinc transporter gene SLC39A13 on chromosome 11p11 and that is characterized by short stature, hyperelastic skin and hypermobile joints, protuberant eyes with bluish sclerae, finely wrinkled palms, and characteristic radiologic features." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:libman_sacks_endocarditis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_immunoglobulin_level ],
        :autoimmune_disease_of_cardiovascular_system,
        :endocarditis ;
    :has_definition "An endocarditis that is characterized by Libman-Sacks vegetations, is common in patients with systemic lupus erythematosus and is commonly complicated with embolic cerebrovascular disease." ;
    :has_exact_synonym "Libmann–Sachs, Endocarditis in systemic lupus erythematosus" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:limbic_encephalitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :seizure ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_immunoglobulin_level ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :temporal_lobe ],
        :autoimmune_disease_of_central_nervous_system,
        :encephalitis ;
    :has_definition "An encephalitis that is characterized by subacute onset of short-term memory deficits, seizures or psychiatric symptoms located_in the medial temporal lobes." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autoimmune_cholangitis rdfs:subClassOf :autoimmune_hepatitis ;
    :has_definition "An autoimmune hepatitis that is characterized by primary biliary cirrhosis clinical, biochemical, and histologic characteristics with antinuclear antibody positive sera." ;
    :has_exact_synonym "autoimmune cholangiopathy" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:transverse_myelitis rdfs:subClassOf :myelitis ;
    :has_definition "A myelitis that is characterized by a band-like sensation across the trunk of the body, with sensory changes below." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:antisynthetase_syndrome rdfs:subClassOf :autoimmune_disease ;
    :has_definition "An autoimmune disease that is characterized by myositis, arthralgia, Raynaud phenomenon, mechanic hands, interstitial lung disease, and serum autoantibodies to aminoacyl transfer RNA synthetases." ;
    :has_exact_match "MESH:C537778" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polymyositis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_immunoglobulin_level ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :autoimmune_disease_of_musculoskeletal_system,
        :myositis ;
    :has_definition "A myositis that is characterized by muscle weakness affecting both sides of your body." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sweet_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :allergic_reaction ],
        :allergic_disease,
        :skin_disease ;
    :has_definition "A skin disease that is characterized by sudden onset of well defined tender plaques or nodules accompanied by fever, arthralgias, ocular inflammation, headaches and, rarely, oral or genital lesions." ;
    :has_exact_synonym "Acute Febrile Neutrophilic Dermatosis",
        "Sweet's syndrome" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_urticaria rdfs:subClassOf :urticaria ;
    :has_definition "An urticaria that is characterized by the presence of urticaria for a period exceeding 6 weeks, assuming symptoms for most days of the week." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_inducible_urticaria rdfs:subClassOf :chronic_urticaria ;
    :has_definition "A chronic urticaria that is characterized by a history of a consistent stimulus that initiates lesions, which are typically short-lived and fleeting, lasting a few minutes up to 2 hours." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_spontaneous_urticaria rdfs:subClassOf :chronic_urticaria ;
    :has_definition "A chronic urticaria that is characterized by urticaria independent of any exogenous stimulus." ;
    :has_exact_synonym "chronic idiopathic urticaria" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:erythema_nodosum rdfs:subClassOf :panniculitis ;
    :has_definition "A panniculitis that is characterized by sudden onset of painful, erythematous, subcutaneous nodules mainly localized to the pretibial areas. Lesions are usually bilateral and symmetrical, ranging from 1 to 5 cm in diameter." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:keratosis_pilaris_atrophicans rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :ichthyosis ;
    :has_definition "An ichthyosis that is characterized by perifollicular keratosis and inflammation that progresses to atrophy and scarring of the facial skin." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:keratosis_pilaris_atrophicans_faciei rdfs:subClassOf :keratosis_pilaris_atrophicans ;
    :has_definition "A keratosis pilaris atrophicans that is characterized by scar-like follicular depressions and loss of hair primarily in the eyebrow area." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:keratosis_follicularis_spinulosa_decalvans rdfs:subClassOf :keratosis_pilaris_atrophicans ;
    :has_definition "A keratosis pilaris atrophicans that is characterized by scarring alopecia of the scalp, eyebrows, and axillae, sometimes associated with photophobia and keratoderma." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:x_linked_keratosis_follicularis_spinulosa_decalvans rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :keratosis_follicularis_spinulosa_decalvans,
        :x_linked_recessive_disease ;
    :has_definition "A keratosis follicularis spinulosa decalvans that has_material_basis_in mutation in the MBTPS2 gene." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_keratosis_follicularis_spinulosa_decalvans rdfs:subClassOf :keratosis_follicularis_spinulosa_decalvans ;
    :has_definition "A keratosis follicularis spinulosa decalvans that has_material_basis_in autosomal dominant inheritance." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atrophoderma_vermiculata rdfs:subClassOf :keratosis_pilaris_atrophicans ;
    :has_definition "A keratosis pilaris atrophicans that typically presents in childhood with erythema and follicular keratotic papules that slowly progress to characteristic atrophy, which has been described as worm-eaten, reticular, or honeycomb, and occurs on the cheeks, preauricular area, and forehead." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fanconi_renotubular_syndrome_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :fanconi_syndrome ;
    :has_definition "A Fanconi syndrome that has_material_basis_in heterozygous mutation in the GATM gene on chromosome 15q21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fanconi_renotubular_syndrome_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :fanconi_syndrome ;
    :has_definition "A Fanconi syndrome that has_material_basis_in homozygous mutation in the SLC34A1 gene on chromosome 5q35." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fanconi_renotubular_syndrome_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :fanconi_syndrome ;
    :has_definition "A Fanconi syndrome that is characterized by characterized by rickets, impaired growth, glucosuria, generalized aminoaciduria, phosphaturia, metabolic acidosis, and low molecular weight proteinuria and that has_material_basis_in heterozygous mutation in the EHHADH gene on chromosome 3q27." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fanconi_renotubular_syndrome_4 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :fanconi_syndrome ;
    :has_definition "A Fanconi syndrome that has_material_basis_in heterozygous mutation in the HNF4A gene on chromosome 20q13." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fanconi_renotubular_syndrome_5 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :fanconi_syndrome ;
    :has_definition "A Fanconi syndrome that is characterized by proximal renotubular dysfunction from birth, followed by progressive kidney disease and pulmonary fibrosis and that has_material_basis_in homozygous mutation in the NDUFAF6 gene on chromosome 8q22." ;
    :has_exact_synonym "Acadian-variant Fanconi syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_limb_girdle_muscular_dystrophy_type_2z rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :progressive_weakness ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :autosomal_recessive_limb_girdle_muscular_dystrophy ;
    :has_definition "An autosomal recessive limb-girdle muscular dystrophy that is characterized by young-adult onset of slowly progressive proximal upper and lower limb muscle weakness and atrophy and that has_material_basis_in homozygous mutation in the POGLUT1 gene on chromosome 3q13." ;
    :has_exact_synonym "limb-girdle muscular dystrophy 21" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diffuse_gastric_cancer rdfs:subClassOf :stomach_cancer ;
    :has_definition "A stomach cancer that is characterized by development of diffuse (signet ring cell) gastric cancer underneath the stomach lining." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hereditary_diffuse_gastric_cancer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :diffuse_gastric_cancer ;
    :has_definition "A diffuse gastric cancer that is characterized by characterized by the development of diffuse (signet ring cell) gastric cancer at a young age, associated with germline heterozygous mutations of CDH1, MAP3K6 and CTNNA1 genes." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_72 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that has_material_basis_in homozygous mutation in the METTL5 gene on chromosome 2q31." ;
    :has_exact_synonym "autosomal recessive intellectual developmental disorder-72",
        "autosomal recessive mental retardation 72" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:erythrokeratodermia_variabilis_et_progressiva_6 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :erythrokeratodermia_variabilis ;
    :has_definition "An erythrokeratodermia variabilis that is characterized by erythematous hyperkeratotic plaques that develop within the first year of life, beginning on distal extremities and progressing to involve the face, wrists, and ankles, with sparing of volar surfaces and that has_material_basis_in heterozygous mutation in the TRPM4 gene on chromosome 19q13." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

