                            owl:onProperty :has_symptom ;
                            owl:someValuesFrom :inflammation ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :myocardium ] ;
                            rdf:rest :nil ] ] ],
        :autoimmune_disease_of_cardiovascular_system,
        :myocarditis ;
    :has_definition "An autoimmune disease of cardiovascular system that is characterized by inflammation of the heart muscle." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pyridoxine_dependent_epilepsy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :epilepsy ;
    :has_close_match "UMLS_CUI:C1849508" ;
    :has_definition "An epilepsy that is characterized by intractable seizures within the first weeks to months of life that are not controlled with antiepileptic drugs but respond both clinically and electrographically to large daily supplements of pyridoxine." ;
    :has_exact_match "GARD:9298",
        "MESH:C536254",
        "ORDO:3006",
        "SNOMEDCT_US_2023_03_01:734434007" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:early_onset_vitamin_b6_dependent_epilepsy_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormality_of_vitamin_b_metabolism ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :pyridoxine_dependent_epilepsy ;
    :has_broad_synonym "early-onset vitamin B6-dependent epilepsy" ;
    :has_definition "A pyridoxine-dependent epilepsy that has_material_basis_in homozygous or compound heterozygous mutation in the PLPBP gene on chromosome 8p11.23." ;
    :has_exact_match "OMIM:617290" ;
    :has_exact_synonym "EPEO1",
        "PDE-PLPBP" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_beta_thalassemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :beta_thalassemia ;
    :has_definition "A beta thalassemia that has_material_basis_in one dominantly inheriteed mutated HBB gene and signs and symptoms of beta-thalassemia major or beta-thalassemia intermedia." ;
    :has_exact_synonym "inclusion body beta-thalassemia" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:beta_thalassemia_major rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :beta_thalassemia ;
    :has_definition "A beta thalassemia that is characterized by severe anemia and enlarged liver and spleen before 2 years of age." ;
    :has_exact_synonym "Cooley's anemia" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:beta_thalassemia_intermedia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :beta_thalassemia ;
    :has_definition "A beta thalassemia that is characterized by mild to moderate anemia along with slow growth and bone abnormalities appearing in early childhood or later in life." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:delta_beta_thalassemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :beta_thalassemia ;
    :has_definition "A beta thalassemia that is characterized by decreased or absent synthesis of both the delta- and beta-globin chains, which leads to a compensatory increase in fetal gamma-chain synthesis. This disorder results in a microcytic anemia that is clinically mild." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thalassemia_minor rdfs:subClassOf :beta_thalassemia ;
    :has_definition "A beta thalassemia that has_material_basis_in one HBB gene mutation without typical thalassemia symptoms, but may have some symptoms of anemia." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:complete_androgen_insensitivity_syndrome rdfs:subClassOf :androgen_insensitivity_syndrome ;
    :has_definition "An androgen insensitivity syndrome that is characterized by complete androgen insensitivity as the body cannot use androgens at all, having the external sex characteristics of females but no uterus." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:partial_androgen_insensitivity_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :androgen_insensitivity_syndrome,
        :x_linked_recessive_disease ;
    :has_definition "An androgen insensitivity syndrome that is characterized by a 46,XY karyotype and testes that produce age-appropriate androgen levels but have undermasculinized external genitalia due to defects in androgen action." ;
    :has_exact_synonym "Reifenstein syndrome" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lung_sarcomatoid_carcinoma rdfs:subClassOf :lung_carcinoma ;
    :has_definition "A lung carcinoma that is characterized by the presence of a sarcomatoid component often associated with giant cell differentiation." ;
    :has_exact_synonym "Sarcomatoid carcinoma of the lung",
        "pulmonary sarcomatoid carcinoma" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:transient_infantile_liver_failure rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :liver_disease ;
    :has_definition "A liver disease that is characterized by elevated liver enzymes, jaundice, vomiting, coagulopathy, and hyperbilirubinemia, and the presence of increased serum lactate and that has_material_basis_in homozygous or compound heterozygous mutation in the TRMU gene, which is involved in mitochondrial protein translation, on chromosome 22q13." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plasmablastic_lymphoma rdfs:subClassOf :diffuse_large_b_cell_lymphoma ;
    :has_definition "A diffuse large B-cell lymphoma that is characterized by the presence of large neoplastic cells resembling B-immunoblasts which have the immunophenotypic profile of plasma cells." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_erythroid_leukemia rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia that is characterized by a predominant immature erythroid population." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

