            owl:onProperty :derives_from ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :epithelial_cell ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_origin ;
                                            owl:someValuesFrom :mucous_gland ] ;
                                    rdf:rest :nil ] ] ] ],
        :mucinous_adenocarcinoma,
        :pancreatic_adenocarcinoma ;
    :has_definition "A pancreatic adenocarcinoma that derives_from epithelial cells originating in glandular tissue, which produce mucin." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:urinary_tract_infection rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :bacteria ],
        :bacterial_infectious_disease,
        :urinary_system_disease ;
    :has_definition "An urinary system disease that is characterized by an infection in any part of the urinary system, including the kidneys, ureters, bladder or urethra." ;
    :has_exact_match "MESH:D014552" ;
    :has_exact_synonym "UTI" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brown_vialetto_van_laere_syndrome_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :brown_vialetto_van_laere_syndrome ;
    :has_definition "A Brown-Vialetto-Van Laere syndrome that is characterized by progressive bulbar palsy with sensorineural deafness that has_material_basis_in homozygous or compound heterozygous mutation in the C20ORF54 gene (SLC52A3) on chromosome 20p13." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brown_vialetto_van_laere_syndrome_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :autosomal_recessive_disease,
        :brown_vialetto_van_laere_syndrome ;
    :has_definition "A Brown-Vialetto-Van Laere syndrome that is characterized by early childhood onset of sensorineural deafness, bulbar dysfunction, and severe diffuse muscle weakness and wasting of the upper and lower limbs and axial muscles, resulting in respiratory insufficiency and that has_material_basis_in homozygous or compound heterozygous mutation in the SLC52A2 gene on chromosome 8q24." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:proximal_symphalangism_1 rdfs:subClassOf :proximal_symphalangism ;
    :has_definition "A proximal symphalangism that is characterized by ankylosis of the proximal interphalangeal joints, carpal and tarsal bone fusion, and, in some cases, conductive deafness and that has_material_basis_in heterozygous mutation in the NOG gene on chromosome 17q22." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:proximal_symphalangism_2 rdfs:subClassOf :proximal_symphalangism ;
    :has_definition "A proximal symphalangism that is characterized by absence of the cuboid bone and lack of shortness of the first and fifth metacarpal bones, and the presence of distal interphalangeal joint fusions and flat feet and that has_material_basis_in heterozygous mutation in the GDF5 gene on chromosome 20q11." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:treacher_collins_syndrome_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :treacher_collins_syndrome ;
    :has_definition "A Treacher Collins syndrome that has_material_basis_in heterozygous mutation in the 'treacle' gene (TCOF1) on chromosome 5q32." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:treacher_collins_syndrome_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :treacher_collins_syndrome ;
    :has_definition "A Treacher Collins syndrome that has_material_basis_in heterozygous mutation in the POLR1D gene on chromosome 13q12." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:treacher_collins_syndrome_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :treacher_collins_syndrome ;
    :has_definition "A Treacher Collins syndrome that has_material_basis_in compound heterozygous mutation in the POLR1C gene on chromosome 6p21." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:treacher_collins_syndrome_4 rdfs:subClassOf :treacher_collins_syndrome ;
    :has_definition "A Treacher Collins syndrome that is characterized by craniofacial dysmorphisms including downslanting palpebral fissures, malar and mandibular hypoplasia, and microtia and that has_material_basis_in heterozygous mutation in the POLR1B gene on chromosome 2q14." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_acute_megakaryoblastic_leukemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :acute_megakaryocytic_leukemia ;
    :has_definition "An acute megakaryocytic leukemia that is characterized by fusion oncogenes involving transcriptional regulators in childhood." ;
    :has_exact_synonym "pediatric non-Down syndrome acute megakaryoblastic leukemia" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_basophilic_leukemia rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia that is characterized by primary differentiation to basophils." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:core_binding_factor_acute_myeloid_leukemia rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia that is characterized by the presence of t(8;21)(q22;q22) or inv(16)(p13q22)/t(16;16)(p13;q22). These cytogenetic abnormalities result in disruption of the transcription factor CBF, which is a regulator of normal hematopoiesis." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nasal_type_extranodal_nk_t_cell_lymphoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :nasal_cavity ],
        :mature_t_cell_and_nk_cell_lymphoma,
        :nasal_cavity_cancer ;
    :has_definition "A mature T-cell and NK-cell lymphoma that is characterized by an often angiocentric and angiodestructive cellular infiltrate composed of EBV positive NK/T cells." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myeloid_leukemia_associated_with_down_syndrome rdfs:subClassOf :acute_megakaryocytic_leukemia ;
    :has_definition "An acute megakaryocytic leukemia occurring in children with Down syndrome and that has_material_basis_in mutation in the GATA1 gene." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sinonasal_undifferentiated_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :paranasal_sinus ],
        :nasal_cavity_carcinoma,
        :paranasal_sinus_cancer ;
    :has_definition "A nasal cavity carcinoma that arises from the sinonasal tract and that is characterized by the presence of small to medium size malignant cells." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:salivary_gland_mucinous_adenocarcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :epithelial_cell ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_origin ;
                                            owl:someValuesFrom :mucous_gland ] ;
                                    rdf:rest :nil ] ] ] ],
        :mucinous_adenocarcinoma,
        :salivary_gland_carcinoma ;
    :has_definition "A salivary gland carcinoma that is characterized by the presence of large pools of extracellular mucin in which clusters of malignant epithelial cells are found." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_craniometaphyseal_dysplasia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :craniometaphyseal_dysplasia ;
    :has_definition "A craniometaphyseal dysplasia that has_material_basis_in heterozygous mutation in the ANKH gene on chromosome 5p15." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_craniometaphyseal_dysplasia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :craniometaphyseal_dysplasia ;
    :has_definition "A craniometaphyseal dysplasia that has_material_basis_in homozygous mutation in the GJA1 gene on chromosome 6q22." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cranioectodermal_dysplasia_1 rdfs:subClassOf :cranioectodermal_dysplasia ;
    :has_definition "A cranioectodermal dysplasia that has_material_basis_in homozygous or compound heterozygous mutation in the IFT122 gene on chromosome 3q21." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cranioectodermal_dysplasia_2 rdfs:subClassOf :cranioectodermal_dysplasia ;
    :has_definition "A cranioectodermal dysplasia that has_material_basis_in compound heterozygous mutation in the WDR35 gene on chromosome 2p24." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cranioectodermal_dysplasia_3 rdfs:subClassOf :cranioectodermal_dysplasia ;
    :has_definition "A cranioectodermal dysplasia that has_material_basis_in homozygous mutation in the IFT43 gene on chromosome 14q24." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cranioectodermal_dysplasia_4 rdfs:subClassOf :cranioectodermal_dysplasia ;
    :has_definition "A cranioectodermal dysplasia that has_material_basis_in compound heterozygous mutation in the WDR19 gene on chromosome 4p14." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_craniodiaphyseal_dysplasia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :craniodiaphyseal_dysplasia ;
    :has_definition "A craniodiaphyseal dysplasia that has_material_basis_in heterozygous mutation in the SOST gene on chromosome 17q21." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mammary_analogue_secretory_carcinoma rdfs:subClassOf :salivary_gland_carcinoma ;
    :has_definition "A salivary gland carcinoma that has_material_basis_in a chromosomal translocation that results in an ETV6-NTRK3 fusion gene." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_asthma rdfs:subClassOf :asthma ;
    :has_definition "An asthma that is characterized by the development of persistent airway inflammation and recurrent attacks of breathlessness and wheezing, which vary in severity and frequency." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_asthma rdfs:subClassOf :asthma ;
    :has_definition "An asthma that is characterized by severe and sudden onset of increasing wheezing, airways closing, smooth muscle contraction, mucus plugging and lower airway edema that may be reversible upon treatment." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:extrinsic_asthma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :airborne_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :allergic_reaction ],
        :allergic_disease,
        :chronic_asthma ;
    :has_definition "A chronic asthma that is triggered by an allergen and that is characterized by an immune system overreaction to a harmless substance, such as pollen or dust, with the subsequent release of immunoglobin E (IgE) antibodies." ;
    :has_exact_synonym "atopic asthma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intermittent_asthma rdfs:subClassOf :chronic_asthma ;
    :has_definition "A chronic asthma that is characterized by severity with symptoms two or fewer days per week, nighttime awakenings two or fewer times per month, use of short-acting beta agonist for symptom control two or fewer days per week and no interference with normal activity." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:persistent_mild_asthma rdfs:subClassOf :chronic_asthma ;
    :has_definition "A chronic asthma that is characterized by severity with symptoms two or more days per week, nighttime awakenings three to four times per month, use of short-acting beta agonist for symptom control two or more days per week and minor limitation of normal activity." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:persistent_moderate_asthma rdfs:subClassOf :chronic_asthma ;
    :has_definition "A chronic asthma that is characterized by severity with daily symptoms, nighttime awakenings more than once per week, daily use of short-acting beta agonist for symptom control and some limitation of normal activity." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_onset_asthma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :chronic_asthma ;
    :has_definition "A chronic asthma that is characterized by first presentation in early childhood." ;
    :has_exact_synonym "childhood asthma" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adult_onset_severe_asthma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        :chronic_asthma ;
    :has_definition "A chronic asthma that is characterized by first presentation in adulthood." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:t2_high_asthma rdfs:subClassOf :chronic_asthma ;
    :has_definition "A chronic asthma that is characterized by the pathophysiology phenotype combination (endotype) of early-onset allergic asthma, late-onset eosinophilic asthma, and aspirin-exacerbated respiratory disease." ;
    :has_exact_synonym "type 2 high endotype" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:t2_low_asthma rdfs:subClassOf :chronic_asthma ;
    :has_definition "A chronic asthma that is characterized by the pathophysiology phenotype combination (endotype) of non-atopic, smoking, obesity related, and elderly and that is characterized by neutrophilic (sputum neutrophils > 40–60%) or paucigranulocytic (i.e., normal sputum levels of both eosinophils and neutrophils) inflammation and a lack of response to corticosteroid therapy." ;
    :has_exact_synonym "type 2 low endotype" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:environmental_induced_asthma rdfs:subClassOf :intrinsic_asthma ;
    :has_definition "An intrinsic asthma that is characterized by exposure to tobacco smoke and other inflammatory gases or particulate matter." ;
    :has_exact_synonym "irritant asthma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:occupational_asthma rdfs:subClassOf :environmental_induced_asthma ;
    :has_definition "An environmental induced asthma that is characterized by a variable airflow limitation due to exposure to inhaled irritants in the workplace." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:exercise_induced_bronchoconstriction rdfs:subClassOf :intrinsic_asthma ;
    :has_definition "An intrinsic asthma that is characterized by narrowing of the airways during or shortly after exercise." ;
    :has_exact_synonym "exercise-induced asthma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aspirin_induced_respiratory_disease rdfs:subClassOf :intrinsic_asthma ;
    :has_definition "An intrinsic asthma that is characterized by severe and prolonged airway obstruction after the ingestion of aspirin or other non-steroidal anti-inflammatory drugs." ;
    :has_exact_synonym "aspirin-sensitive asthma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:near_fatal_asthma rdfs:subClassOf :acute_asthma ;
    :has_definition "An acute asthma that is characterized by a respiratory arrest or arterial carbon dioxide tension greater than 50 mmHg, with or without altered consciousness, requiring mechanical ventilation." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:persistent_severe_asthma rdfs:subClassOf :chronic_asthma ;
    :has_definition "A chronic asthma that is characterized by severity with symptoms two or fewer days per week, nighttime awakenings two or fewer times per month, use of short-acting beta agonist for symptom control several times per day and extremely limited normal activity." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thunderstorm_triggered_asthma rdfs:subClassOf :allergic_asthma ;
    :has_definition "An allergic asthma that is characterized by acute asthma attacks immediately following a thunderstorm resulting from inhalation of high concentrations of aeroallergens, most commonly grass pollen." ;
    :has_exact_synonym "thunderstorm asthma",
        "thunderstorm related asthma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nocturnal_asthma rdfs:subClassOf :chronic_asthma ;
    :has_definition "A chronic asthma that is characterized by significant decline in pulmonary function and increase of airway inflammation at night. During sleep, recumbent posture causes a reduction in the lung volumes, respiratory muscle tone, and lung compliance. The overnight physiological abnormalities include: increased airway inflammation and decreased steroid responsiveness, increased pulmonary capillary blood volume, functional differences in blood/air volume ratios and mechanical coupling of the parenchyma to the airways." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:human_cytomegalovirus_infection rdfs:subClassOf :viral_infectious_disease ;
    :has_definition "A viral infectious disease that has_material_basis_in Human betaherpesvirus 5." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vexas_syndrome rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome that is characterized by blood clots in veins, recurrent fevers, pulmonary abnormalities and vacuoles in myeloid cells and that has_material_basis_in mutation in the UBA1 gene on chromosome Xp11." ;
    :has_exact_synonym "vacuoles, E1 enzyme, X-linked, autoinflammatory and somatic syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:low_grade_glioma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :glial_cell ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :central_nervous_system ],
        :brain_disease,
        :cell_type_benign_neoplasm,
        :central_nervous_system_benign_neoplasm,
        :spinal_cord_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :benign_neoplasm ;
                    rdf:rest [ rdf:first [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :derives_from ;
                                                    owl:someValuesFrom :glial_cell ] ;
                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                            owl:onProperty :disease_has_location ;
                                                            owl:someValuesFrom :brain ] ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :disease_has_location ;
                                                                    owl:someValuesFrom :spinal_cord ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A cell type benign neoplasm that has_material_basis_in glial cells (astrocytes, oligodendrocytes or ependymocytes)." ;
    :has_exact_synonym "benign glioma" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_low_grade_glioma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :low_grade_glioma ;
    :has_definition "A low-grade glioma that occurs in children and encompasses tumors of astrocytic, oligodendroglial, and mixed glial-neuronal histology." ;
    :has_exact_synonym "pediatric low-grade glioma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:subjective_cognitive_decline rdfs:subClassOf :cognitive_disorder ;
    :has_definition "A cognitive disorder that is characterized by the presence of significant and persistent cognitive complaints." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mild_cognitive_impairment rdfs:subClassOf :cognitive_disorder ;
    :has_definition "A cognitive disorder that is characterized by objective impairment in cognition with minimal impairment of their capacity to undertake the instrumental activities of daily living." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:laryngomalacia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :stridor ],
        :laryngeal_disease,
        :physical_disorder ;
    :has_definition "A laryngeal disease that is characterized by inward collapse of flaccid supraglottic structures during inspiration. The most common symptom is noisy breathing (stridor) that is often worse when the infant is on his/her back or crying." ;
    :has_exact_synonym "congenital laryngomalacia" ;
    :has_narrower_match "MESH:D055092" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acquired_laryngomalacia rdfs:subClassOf :laryngeal_disease ;
    :has_definition "A laryngeal disease that is characterized by acquired collapse of laryngeal suprastructures." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:torch_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :physical_disorder,
        :syndrome ;
    :has_definition "A syndrome that is characterized by congenital infection with toxoplasmosis, rubella, cytomegalovirus, herpes simplex, and other organisms." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:growth_hormone_insensitivity_syndrome_with_immune_dysregulation_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by short stature due to insensitivity to growth hormone and that has_material_basis_in homozygous mutation in the STAT5B gene on chromosome 17q21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:growth_hormone_insensitivity_syndrome_with_immune_dysregulation_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition """A syndrome that is characterized by short stature due to insensitivity to growth hormone and
that has_material_basis_in heterozygous mutation in the STAT5B gene on chromosome 17q21.""" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:x_linked_warfarin_sensitivity rdfs:subClassOf :inherited_metabolic_disorder ;
    :has_definition "An inherited metabolic disorder that is characterized by bleeding complications when given warfarin for anticoagulation and that has_material_basis_in variation in the F9 gene on chromosome Xq27." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:optic_atrophy_12 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :optic_atrophy ;
    :has_definition "An optic atrophy that is characterized by slowly progressive visual impairment with onset usually in the first decade and that has_material_basis_in heterozygous mutation in the AFG3L2 gene on chromosome 18p11." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pemphigoid rdfs:subClassOf [ owl:intersectionOf [ rdf:first :dermatitis ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_symptom ;
                                    owl:someValuesFrom :blister ] ;
                            rdf:rest :nil ] ] ],
        :autoimmune_disease_of_skin_and_connective_tissue,
        :bullous_skin_disease ;
    :has_definition "An autoimmune disease of skin and connective tissue that is characterized by subepidermal blistering especially in the lower abdomen, groin, and flexor surfaces of the extremities, creating tense blisters that do not break easily." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

