@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rapidly_involuting_congenital_hemangioma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :hemangioma,
        :physical_disorder ;
    :has_definition "A hemangioma that is characterized by complete regression." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pericytoma_with_t_7_12_ rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :translocation ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :gene_fusion ],
        :perivascular_tumor ;
    :has_definition "A perivascular tumor that is characterized by a perivascular pattern of spindle-to-ovoid cell proliferation and that has_material_basis_in t(7;12)(p22;q13) translocation with resultant ACTB-GLI1 fusion." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:solitary_fibrous_tumor_hemangiopericytoma rdfs:subClassOf :connective_tissue_cancer ;
    :has_definition "A connective tissue cancer that is characterized as the combination of solitary fibrous tumors and hemangiopericytomas." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebellofaciodental_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by delayed development, intellectual disability, abnormal facial and dental findings, and cerebellar hypoplasia and that has_material_basis_in homozygous or compound heterozygous mutation in the BRF1 gene on chromosome 14q32." ;
    :has_exact_synonym "cerebellar-facial-dental syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lung_pleomorphic_carcinoma rdfs:subClassOf [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :lung ] ;
                            rdf:rest :nil ] ] ],
        :lung_cancer,
        :pleomorphic_carcinoma ;
    :has_definition "A pleomorphic carcinoma that is characterized by the presence of malignant glandular or squamous cells associated with malignant giant and spindle cells and that is located_in the lung." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oral_rhabdomyosarcoma rdfs:subClassOf [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :oral_cavity ] ;
                            rdf:rest :nil ] ] ],
        :oral_cavity_cancer,
        :rhabdomyosarcoma ;
    :has_definition "A rhabdomyosarcoma located in the oral cavity." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bladder_sarcomatoid_transitional_cell_carcinoma rdfs:subClassOf [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :derives_from ;
                                                    owl:someValuesFrom :epithelial_cell ] ;
                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                            owl:onProperty :disease_has_location ;
                                                            owl:someValuesFrom :urinary_bladder ] ;
                                                    rdf:rest :nil ] ] ] ;
                            rdf:rest :nil ] ] ],
        :sarcomatoid_transitional_cell_carcinoma,
        :urinary_bladder_cancer ;
    :has_definition "A sarcomatoid transitional cell carcinoma that is located_in the bladder." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bladder_small_cell_carcinoma rdfs:subClassOf :bladder_carcinoma ;
    :has_definition "A bladder carcinoma that is characterized as an undifferentiated neoplasm composed of primitive-appearing cells." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:embryonal_tumor_with_multilayered_rosettes_c19mc_altered rdfs:subClassOf :embryonal_tumor_with_multilayered_rosettes ;
    :has_definition "An embryonal tumor with multilayered rosettes that is characterized by the presence of multilayered rosettes formation and the presence of amplification of the C19MC region on chromosome 19 (19q13.42)." ;
    :has_exact_synonym "ependymoblastoma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:astroblastoma_mn1_altered rdfs:subClassOf :astroblastoma ;
    :has_definition "An astroblastoma that is characterized by astroblastoma-like morphology with MN1 rearrangements involving the meningioma 1 (MN1) gene on chromosome 22q." ;
    :has_exact_synonym "CNS high-grade neuroepithelial tumors with MN1 alteration" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_nervous_system_neuroblastoma rdfs:subClassOf :central_nervous_system_germ_cell_tumor ;
    :has_definition "A central nervous system germ cell tumor that is characterized by the presence of neuroblastic cells, the absence of ganglion cells, and the absence of a prominent Schwannian stroma formation and that arising from the cerebral hemispheres." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cns_neuroblastoma_with_foxr2_activation rdfs:subClassOf :central_nervous_system_neuroblastoma ;
    :has_definition "A central nervous system neuroblastoma that is characterized by FOXR2 activation and that is composed of small, round cells with hyperchromatic nuclei surrounded by a clear halo." ;
    :has_exact_synonym "CNS NB-FOXR2",
        "CNS neuroblastoma, FOXR2-activated",
        "central nervous system neuroblastoma with FOXR2 activation" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cockayne_syndrome_a rdfs:subClassOf :cockayne_syndrome ;
    :has_definition "A Cockayne syndrome that has_material_basis_in homozygous or compound heterozygous mutation in the gene encoding the group 8 excision repair cross-complementing protein on chromosome 5q11." ;
    :has_exact_synonym "Cockayne syndrome type 1",
        "Cockayne syndrome type I" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cockayne_syndrome_b rdfs:subClassOf :cockayne_syndrome ;
    :has_definition "A Cockayne syndrome that is characterized by severe physical and mental retardation, microcephaly, progressive neurologic and retinal degeneration, skeletal abnormalities, gait defects, and sun sensitivity with no increased frequency of cancer, and that has_material_basis_in homozygous or compound heterozygous mutation in the gene encoding the group 6 excision repair cross-complementing protein on chromosome 10q11." ;
    :has_exact_synonym "Cockayne syndrome 2",
        "Cockayne syndrome type II" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:castration_resistant_prostate_carcinoma rdfs:subClassOf :prostate_carcinoma ;
    :has_broader_match "MESH:D064129" ;
    :has_definition "A prostate carcinoma that is characterized by continued growth and spread despite the surgical removal of the testes or medical intervention to block androgen production." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebrooculofacioskeletal_syndrome rdfs:subClassOf :cockayne_syndrome ;
    :has_definition "A Cockayne syndrome that is characterized by very severe prenatal developmental anomalies including microcephaly, congenital cataracts, severe mental retardation, facial dysmorphism, and arthrogryposis." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebrooculofacioskeletal_syndrome_1 rdfs:subClassOf :cerebrooculofacioskeletal_syndrome ;
    :has_definition "A cerebrooculofacioskeletal syndrome that has_material_basis_in homozygous or compound heterozygous mutation in the ERCC6 gene on chromosome 10q11." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebrooculofacioskeletal_syndrome_2 rdfs:subClassOf :cerebrooculofacioskeletal_syndrome ;
    :has_definition "A cerebrooculofacioskeletal syndrome that has_material_basis_in compound heterozygous mutation in the DNA repair gene XPD (ERCC2) on chromosome 19q13." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebrooculofacioskeletal_syndrome_3 rdfs:subClassOf :cerebrooculofacioskeletal_syndrome ;
    :has_definition "A cerebrooculofacioskeletal syndrome that has_material_basis_in homozygous mutation in the ERCC5 gene on chromosome 13q33." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebrooculofacioskeletal_syndrome_4 rdfs:subClassOf :cerebrooculofacioskeletal_syndrome ;
    :has_definition "A cerebrooculofacioskeletal syndrome that has_material_basis_in homozygous or compound heterozygous mutation in the ERCC1 gene on chromosome 19q13." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:histiocytic_sarcoma rdfs:subClassOf :histiocytic_and_dendritic_cell_cancer ;
    :has_definition "A histiocytic and dendritic cell cancer that is characterized by the presence of neoplastic cells with morphologic and immunophenotypic characteristics similar to those seen in mature histiocytes." ;
    :has_exact_match "MESH:D054747" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:erythroleukemia rdfs:subClassOf :acute_erythroid_leukemia ;
    :has_definition "An acute erythroid leukemia characterized by the presence of at least 50% erythroid precursors and at least 20% myeloblasts in the bone marrow." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sporatic_amyotrophic_lateral_sclerosis rdfs:subClassOf :amyotrophic_lateral_sclerosis ;
    :has_definition "An amyotrophic lateral sclerosis that is characterized by random occurance of ALS without any known cause or familial member with ALS." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polymicrogyria rdfs:subClassOf :brain_disease ;
    :has_definition "A brain disease that is characterized by malformation of the developing brain characterized by abnormal cortical lamination and an unusual folding pattern of the cerebral cortex such that all or part of the brain surface is taken up by an excessive number of small folds (gyri)." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:unilateral_focal_polymicrogyria rdfs:subClassOf :polymicrogyria ;
    :has_definition "A polymicrogyria that is characterized by excessive cortical folding and abnormal cortical layering, that affects only one small region of the brain and that may show no neurologic involvement." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bilateral_generalized_polymicrogyria rdfs:subClassOf :polymicrogyria ;
    :has_definition "A polymicrogyria that is characterized severe intellectual disability, problems with movement, and seizures and that affects the entire brain." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bilateral_frontal_polymicrogyria rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :intellectual_disability ],
        :polymicrogyria ;
    :has_definition "A polymicrogyria that is characterized as a symmetric and bilateral form (in both brain hemispheres) that only involves the frontal lobes without including the area located behind the Sylvius fissure or the area located behind the Rolando sulcus. Symptoms included delayed motor and language milestones; spastic (stiffness) hemiparesis (weakness in one side of the body) or quadriparesis (weakness in all four limbs of the body); and mild to moderate intellectual disability." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bilateral_frontoparietal_polymicrogyria rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :polymicrogyria ;
    :has_definition "A polymicrogyria that is characterized by excessive cortical folding and abnormal cortical layering, that involves the frontoparietal region of the brain and that presents with hypotonia, developmental delay, moderate to severe intellectual disability, pyramidal signs, epileptic seizures, non progressive cerebellar ataxia, dysconjugate gaze and/or strabismus and that has_material_basis_in homozygous mutation in the ADGRG1 gene on chromosome 16q21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bilateral_parasagittal_parieto_occipital_polymicrogyria rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :polymicrogyria ;
    :has_definition "A polymicrogyria that is characterized by bilateral malformation of cortical development, centered around the parasagittal and mesial aspects of the parietooccipital cortex and that has_material_basis_in homozygous mutation in the FIG4 gene on chromosome 6q21." ;
    :has_exact_synonym "bilateral temporooccipital polymicrogyria" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bilateral_perisylvian_polymicrogyria rdfs:subClassOf :polymicrogyria ;
    :has_definition "A polymicrogyria that is characterized by strikingly restricted polymicrogyria limited to the cortex surrounding the Sylvian fissure and that has_material_basis_in homozygous deletion of one 15-bp tandem repeat in a regulatory region of exon 1m of the ADGRG1 gene on chromosome 16q21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cytochrome_p450_oxidoreductase_deficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :steroid_inherited_metabolic_disorder ;
    :has_definition "A steroid inherited metabolic disorder that is characterized by combined deficiency of P450C17 and P450C21 and accumulation of steroid metabolites and that has_material_basis_in homozygous or compound heterozygous mutations in the POR gene, which encodes cytochrome p450 oxidoreductase, on chromosome 7q11.2." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:7q11_23_duplication_syndrome rdfs:subClassOf :chromosomal_duplication_syndrome ;
    :has_definition "A chromosomal duplication syndrome that is characterized by motor, speech and language delay, behavior problems, intellectual disability, low muscle tone (hypotonia), an increased head circumference (macrocephaly), facial dysmorphism, seizures, brain abnormalities, and heart defects such as enlargement of the blood vessel that carries blood from the heart to the rest of the body (aortic dilatation) and that has_material_basis_in an extra copy of a region of the long arm of chromosome 7." ;
    :has_exact_synonym "7q11.23 microduplication syndrome",
        "William-Beuren region duplication syndrome",
        "chromosome 7q11.23 duplication syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:apolipoprotein_a_iv_associated_amyloidosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :kidney ],
        :amyloidosis,
        :kidney_disease ;
    :has_definition "An amyloidosis that is characterized by slowly progressive renal dysfunction, increased serum creatinine, mostly normal urine analysis with no significant proteinuria and associated heart disease." ;
    :has_exact_synonym "AApoAIV amyloidosis",
        "renal AApoAIV amyloidosis" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dialysis_related_amyloidosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :kidney ],
        :amyloidosis,
        :kidney_disease ;
    :has_definition "An amyloidosis that is characterized by the deposition of amyloid fibrils, principally composed of β2 microglobulins (β2M), in the osteoarticular structures and viscera and that is a serious complication of long-term dialysis therapy." ;
    :has_exact_synonym "ABeta2M amyloidosis",
        "Amyloidosis Beta2M",
        "Aβ2M amyloidosis",
        "Beta2-microglobulinic amyloidosis",
        "dialysis-related beta2-microglobulin amyloidosis" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:variant_a_beta2m_amyloidosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :amyloidosis,
        :autosomal_dominant_disease,
        :inherited_metabolic_disorder ;
    :has_definition "An amyloidosis that is characterized by accumulation and extensive visceral deposition of anamyloidogenic variant of beta 2 microglobulin leading to progressive gastrointestinal dysfunction, Sjögren syndrome and autonomic neuropathy." ;
    :has_exact_synonym "Autosomal dominant beta2-microglobulinic amyloidosis" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_localized_cutaneous_amyloidosis_1 rdfs:subClassOf :primary_cutaneous_amyloidosis ;
    :has_definition "A primary cutaneous amyloidosis that has_material_basis_in heterozygous mutation in the gene encoding oncostatin M receptor-beta (OSMR) on chromosome 5p13." ;
    :has_exact_synonym "familial primary localized cutaneous amyloidosis-1" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_localized_cutaneous_amyloidosis_2 rdfs:subClassOf :primary_cutaneous_amyloidosis ;
    :has_definition "A primary cutaneous amyloidosis that has_material_basis_in heterozygous mutation in the IL31RA gene on chromosome 5q11." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_localized_cutaneous_amyloidosis_3 rdfs:subClassOf :primary_cutaneous_amyloidosis ;
    :has_definition "A primary cutaneous amyloidosis that is characterized by deposits of keratinocyte-derived amyloid in the skin and that has_material_basis_in homozygous or compound heterozygous mutation in the GPNMB gene on chromosome 7p15. Onset occurs before puberty and involves macular or reticulate hyperpigmentation admixed with symmetrically distributed guttate hypopigmented and hyperpigmented lesions." ;
    :has_exact_synonym "Amyloidosis cutis dyschromica" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunoglobulin_light_chain_amyloidosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :liver ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :heart ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :nerve ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :kidney ],
        :amyloidosis,
        :heart_disease,
        :inherited_metabolic_disorder,
        :kidney_disease,
        :liver_disease ;
    :has_definition "An amyloidosis that is characterized by misfolded and aggregated amyloidogenic immunoglobulin light chains produced by marrow clonal plasma cells." ;
    :has_exact_synonym "AL amyloidosis",
        "Amyloidosis primary systemic",
        "Light chain amyloidosis",
        "Primary AL amyloidosis",
        "Primary systemic AL amyloidosis",
        "Primary systemic amyloidosis",
        "Systemic AL amyloidsis" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunoglobulin_heavy_chain_amyloidosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :kidney ],
        :amyloidosis,
        :kidney_disease ;
    :has_definition "An amyloidosis that is characterized by the aggregation and deposition of amyloid fibrils composed of monoclonal immunoglobulin heavy-chain fragments, usually produced by a plasma cell neoplasm." ;
    :has_exact_synonym "AH amyloidosis",
        "Amyloidosis derived from immunoglobulin heavy chain",
        "Heavy chain amyloidosis",
        "Ig heavy-chain–associated amyloidosis" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunoglobulin_heavy_and_light_chain rdfs:subClassOf :amyloidosis ;
    :has_definition "An amyloidosis that is characterized by both Ig heavy chains and LC contribute to the amyloid fibrils." ;
    :has_exact_synonym "AH/AL amyloidosis",
        "Ig heavy-and-light-chain amyloidosis" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:serum_amyloid_a_amyloidosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :spleen ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :kidney ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :liver ],
        :amyloidosis,
        :kidney_disease,
        :liver_disease,
        :splenic_disease ;
    :has_definition "An amyloidosis that is characterized by sustained high levels of inflammatory serum amyloid A protein when inflammation is present in the body." ;
    :has_exact_synonym "AA amyloidosis",
        "Apo serum amyloid A amyloidosis",
        "inflammation AA amyloidosis",
        "secondary amyloidosis" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:wild_type_amyloidosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :heart ],
        :amyloidosis,
        :heart_disease ;
    :has_definition "An amyloidosis that is characterized by progressive instability, misfolding and formation of amloid fibrils of the transthyretin protein." ;
    :has_exact_synonym "ATTRwt amyloidosis",
        "Age related amyloidosis",
        "Old age amyloidosis",
        "senile systemic amyloidosis",
        "wild-type ATTR amyloidosis",
        "wild-type transthyretin cardiac amyloidosis" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nonobstructive_coronary_artery_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :neck_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :severe_chest_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pain ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :coronary_stenosis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :shoulder_pain ],
        :coronary_artery_disease ;
    :has_definition "A coronary artery disease that is characterized by atherosclerotic plaque that would not be expected to obstruct blood flow or result in anginal symptoms and stenosis of coronary artery less than 50 percent." ;
    :has_exact_synonym "non-CAD" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hereditary_angioedema_type_i rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :hereditary_angioedema ;
    :has_definition "A hereditrary angioedema that has_material_basis_in heterozygous mutation in the C1 inhibitor gene (C1NH, SERPING1) on chromosome 11q." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hereditary_angioedema_type_iii rdfs:subClassOf :hereditary_angioedema ;
    :has_definition "A hereditary angioedema that is characterized clinically by recurrent skin swelling, abdominal pain attacks, and potentially life-threatening upper airway obstruction and that has_material_basis_in heterozygous mutation in the gene encoding coagulation factor XII (F12) on chromosome 5q35." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acquired_angioedema rdfs:subClassOf :angioedema ;
    :has_definition "An angioedema that is characterized by an acquired deficiency of (C1-INH) caused by either consumption or inactivation." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anauxetic_dysplasia rdfs:subClassOf :spondyloepimetaphyseal_dysplasia ;
    :has_definition "A spondyloepimetaphyseal dysplasia that is characterized by the prenatal onset of extreme short stature, an adult height of less than 85 cm, hypodontia, and mild mental retardation." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:46_xx_sex_reversal_5 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :46_xx_sex_reversal,
        :autosomal_dominant_disease ;
    :has_definition "A 46,XX sex reversal that is characterized by genital virilization in 46,XX individuals, associated with congenital heart disease and variable somatic anomalies including blepharophimosis-ptosis-epicanthus inversus syndrome and congenital diaphragmatic hernia and that has_material_basis_in heterozygous mutation in the NR2F2 gene on chromosome 15q26." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_behcet_like_autoinflammatory_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease that is characterized by characterized by ulceration of mucosal surfaces, particularly in the oral and genital areas and that has_material_basis_in heterozygous mutation in the TNFAIP3 gene on chromosome 6q23." ;
    :has_exact_synonym "A20 haploinsufficiency" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:abdominal_obesity_metabolic_syndrome_4 rdfs:subClassOf :abdominal_obesity_metabolic_syndrome ;
    :has_definition "An abdominal obesity-metabolic syndrome that is characterized by obesity, hypertension, and early-onset coronary artery disease and that has_material_basis_in heterozygous mutation in the CELA2A gene on chromosome 1p36." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:retinal_dystrophy_with_leukodystrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :peroxisomal_disease ;
    :has_definition "A peroxisomal disease that is characterized by a peroxisomal enzyme deficiency caused by impaired very long chain fatty acid (VLCFA) metabolism and that has_material_basis_in homozygous mutation in the ACBD5 gene on chromosome 10p12." ;
    :has_exact_synonym "ACBD5 deficiency" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_flaccid_myelitis rdfs:subClassOf :myelitis ;
    :has_definition "A myelitis that is characterized by acute onset of flaccid weakness of one or more limbs." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:agenesis_of_corpus_callosum_cardiac_ocular_and_genital_syndrome rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome that is characterized by global developmental delay and/or intellectual disability, corpus callosum agenesis or hypoplasia, craniofacial dysmorphisms, and ocular, cardiac, and genital anomalies and that has_material_basis_in heterozygous mutation in the CDH2 gene on chromosome 18q12." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alcoholic_ketoacidosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_disease_driver ;
            owl:someValuesFrom :alcohol ],
        :metabolic_acidosis ;
    :has_definition "A metabolic acidosis that is characterized by the buildup of ketones in the blood due to alcohol use. Ketones are a type of acid that form when the body breaks down fat for energy." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alopecia_mental_retardation_syndrome_4 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :alopecia_mental_retardation_syndrome,
        :autosomal_recessive_disease ;
    :has_definition "An alopecia-mental retardation syndrome that has_material_basis_in homozygous or compound heterozygous mutation in the LSS gene on chromosome 21q22." .
